class Solution(object):
    def checkInclusion(self, s1, s2):
        """
        给定两个字符串 s1 和 s2，写一个函数来判断 s2 是否包含 s1 的排列。
        换句话说，第一个字符串的排列之一是第二个字符串的子串。
        ---
        输入: s1 = "ab" s2 = "eidbaooo"
        输出: True
        解释: s2 包含 s1 的排列之一 ("ba").
        ---
        输入: s1= "ab" s2 = "eidboaoo"
        输出: False
        --
        思路:

        :type s1: str
        :type s2: str
        :rtype: bool
        """
        n1 = len(s1)
        # s1 = sorted(s1)
        n2 = len(s2)
        for i in range(n2):
            temp = s2[i:i + n1]
            for j in set(temp):
                if s1.count(j) != temp.count(j):
                    break
            return True
        return False

    def checkInclusion1(self, s1, s2):
        from collections import Counter
        n1 = len(s1)
        s1 = Counter(s1)
        n2 = len(s2)
        if n1 > n2:
            return False
        lookup = Counter(s2[:n1])

        print(lookup)
        l = 0
        for i in range(n1, n2):
            if s1 == lookup:
                return True
            lookup[s2[l]] -= 1
            lookup[s2[i]] += 1
            l += 1
        # print(lookup)
        return True if s1 == lookup else False


a = Solution()
print(a.checkInclusion1(s1="ab", s2="eidboaoo"))
print(a.checkInclusion1(s1="ab", s2="eidbaooo"))
print(a.checkInclusion1("adc", "dcda"))
